script: |
  super -f text -I q9377.spq | sort > q9377.out

inputs:
  - name: q9377.spq
    data: |
      SELECT ALL * FROM tab1 (FORMAT parquet) WHERE col2 NOT IN ( - 6 * col0 / col2 / + 79 - + - ( - col0 ) + 99 * - col2 - col2, 30 * - - 52 * - 40 * + + 88 );
  - name: tab1

outputs:
  - name: q9377.out
    data: |
      51	14	96
      85	5	59
      91	47	68
